import React, { useState, useEffect } from 'react';
import LoginForm from './components/LoginForm';
import axios from './api/axios';

// Dashboard component to display the fetched data
const Dashboard = ({ dashboardData, loading }) => {
  if (loading) {
    return <p>Loading dashboard data...</p>;
  }

  if (!dashboardData) {
    return <p>No dashboard data available.</p>;
  }

  return (
    <div>
      <h2>Dashboard</h2>
      <div>
        <p><strong>Total Students:</strong> {dashboardData.totalStudents}</p>
        <p><strong>Students Vaccinated:</strong> {dashboardData.studentsVaccinated}</p>
        <p><strong>Vaccinated Percentage:</strong> {dashboardData.vaccinatedPercentage}%</p>
        <h3>Upcoming Vaccination Drives</h3>
        {dashboardData.vaccinationDriveList && dashboardData.vaccinationDriveList.length > 0 ? (
          <table style={{ width: '100%', border: '1px solid gray', marginTop: '20px' }}>
            <thead>
              <tr>
                <th>Drive Identifier</th>
                <th>Title</th>
                <th>Scheduled Date</th>
                <th>Location</th>
                <th>Available Dozes</th>
                <th>Applicable Classes</th>
              </tr>
            </thead>
            <tbody>
              {dashboardData.vaccinationDriveList.map((drive) => (
                <tr key={drive.id}>
                  <td>{drive.driveIdentifier}</td>
                  <td>{drive.title}</td>
                  <td>{new Date(drive.scheduledDate).toLocaleString()}</td>
                  <td>{drive.location}</td>
                  <td>{drive.availableDozes}</td>
                  <td>{drive.applicableClasses.join(', ')}</td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p>No vaccination drives available.</p>
        )}
      </div>
    </div>
  );
};

// Main App component
const App = () => {
  const [token, setToken] = useState('');
  const [dashboardData, setDashboardData] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // Fetching dashboard data whenever the token changes
  useEffect(() => {
    if (token) {
      fetchDashboardData();
    }
  }, [token]);

  // Fetch dashboard data from the backend
  const fetchDashboardData = async () => {
    setLoading(true);
    setError(null);  // Reset error state before fetching

    try {
      const response = await axios.post('/dashboard/overview');
      setDashboardData(response.data);
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
      setError('Failed to load dashboard data.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div>
      <h1>School Vaccination Portal</h1>
      {!token ? (
        <LoginForm setToken={setToken} />
      ) : (
        <>
          {error && <p style={{ color: 'red' }}>{error}</p>}
          <Dashboard dashboardData={dashboardData} loading={loading} />
        </>
      )}
    </div>
  );
};

export default App;
